import React from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Components {
  constructor(){
    super();
    this.state = {
      monsters : [
      {
        name : 'Goblin',
        id : 'mon1'
      },
      {
        name : 'Dragon',
        id : 'mon2'
      },
      {
        name : 'Kapa',
        id : 'mon3'
      },
      {
        name : 'Slime',
        id : 'mon4'
      }
    ]
    }
  }
}

export default App;
